int findValueOfPartition(int* nums, int numsSize) {
    int i, minValue = __INT_MAX__;
    // Sort the array first
    for (i = 0; i < numsSize - 1; i++) {
        for (int j = 0; j < numsSize - i - 1; j++) {
            if (nums[j] > nums[j + 1]) {
                int temp = nums[j];
                nums[j] = nums[j + 1];
                nums[j + 1] = temp;
            }
        }
    }
    // Find the minimum value of partition
    for (i = 1; i < numsSize; i++) {
        if (nums[i] - nums[i - 1] < minValue) {
            minValue = nums[i] - nums[i - 1];
        }
    }
    return minValue;
}
